import React from 'react';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import ListSubheader from '@material-ui/core/ListSubheader';
import DashboardIcon from '@material-ui/icons/Dashboard';
import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';
import PeopleIcon from '@material-ui/icons/People';
import BarChartIcon from '@material-ui/icons/BarChart';
import LayersIcon from '@material-ui/icons/Layers';
import AssignmentIcon from '@material-ui/icons/Assignment';
import { Person, Deck,Pages,Add } from '@material-ui/icons'
import { Redirect } from 'react-router';




export default MainListItems = ()=>{

  
const handleroom = ()=>{

  return <Redirect to='home/initJoinRoom'/> 
}
  return(  <div>
    <ListItem button>
      <ListItemIcon>
        <Pages />
      </ListItemIcon>
      <ListItemText primary="MyChannel" />
    </ListItem>
    <ListItem button onClick={handleroom}>
      <ListItemIcon>
        <Deck />
      </ListItemIcon>
      <ListItemText primary="My Rooms" />
    </ListItem>
    <ListItem button>
      <ListItemIcon>
        <Person />
      </ListItemIcon>
      <ListItemText primary="Profile" />
      
    </ListItem>
    <ListItem button>
      <ListItemIcon>
        <Add/>
      </ListItemIcon>
      <ListItemText primary="CreateRoom" />
      
    </ListItem>
  </div>)
}

